import React, { Component } from 'react'
import './Header.scss';

export default class Header extends Component {
    render() {
        return (
            <nav className="navbar fixed-top navbar-dark bg-dark">
                <h1 className="navbar-brand" >Someone</h1>

                <div className="navbar-nav" id="navBarContent">
                            <a className="nav-item nav-link active"  href="#">First</a>
                            <a className="nav-item nav-link" href="#">Second</a>
                            <a className="nav-item nav-link" href="#">Third</a>
                </div>
            </nav>
        )
    }
}
